new Vue({el:"#dashboard",data:{registerCount:0,favoriteIntegers:[],recent:[]},methods:{UpdateStats:function(){var n=this;axios({method:"get",url:"/ApiProxy/count"}).then(function(t){n.registerCount=t.data.toLocaleString()});axios({method:"get",url:"/ApiProxy/favorites"}).then(function(t){n.favoriteIntegers=t.data});axios({method:"get",url:"/ApiProxy/recent"}).then(function(t){n.recent=t.data});setTimeout(this.UpdateStats,5e3)}},beforeMount:function(){this.UpdateStats()}});